import React from 'react';
import appStyles from '../../App.module.css';
import styles from './About.module.css';
import profileImg from '../../assets/profile.jpg'; // Adjust path to your image

const About = () => (
  <section id="about" className={appStyles.sectionWrapper}>
    <div className={styles.aboutContainer}>
      <img src={profileImg} alt="Profile" className={styles.profileImg} />
      <div className={styles.aboutText}>
        <h2 className={styles.sectionTitle}>About Me</h2>
        <p>
          Passionate developer with experience in building modern web applications. Skilled in React, Node.js, and UI/UX design. Always eager to learn and collaborate!
        </p>
      </div>
    </div>
  </section>
);

export default About;
